            <span>&rarr;</span> {cohortListsProj.projectsList.cohortProjName.value}

            <Cohort_infoComponent projectInfoReq={cohortListsProj.projectName} cohortInfoReq={cohortListsProj.projectsList.cohortProjName.value}/>
        
